import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from "react-router-dom";
import './tailwind.output.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import firebase from 'firebase/app';

var firebaseConfig = {
  apiKey: "AIzaSyDzz7nu9vZAePH0BSgqsDvbeCz38R-S2io",
  authDomain: "budget-app-c0755.firebaseapp.com",
  databaseURL: "https://budget-app-c0755.firebaseio.com",
  projectId: "budget-app-c0755",
  storageBucket: "budget-app-c0755.appspot.com",
  messagingSenderId: "141313870596",
  appId: "1:141313870596:web:0db5537b701f3b5d439e51",
  measurementId: "G-BLC1PP76TH"
};

// Initialize Firebase
firebase.initializeApp(firebaseConfig);

ReactDOM.render(
  <Router>
    <App />
  </Router>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
